import React from 'react';

const About = () => {
    return (
        <section id="about" className="about-section">
            <h2>Tentang Saya</h2>
            <p>
                Saya adalah seorang penggemar IoT dan Embedded Systems dengan latar belakang dalam pengembangan perangkat keras dan perangkat lunak. 
                Passion saya terletak pada menciptakan solusi inovatif yang menghubungkan dunia fisik dengan teknologi.
            </p>
            <p>
                Dengan pengalaman dalam membangun perangkat keras, mengembangkan firmware, dan menghubungkan perangkat ke cloud, 
                saya berkomitmen untuk terus belajar dan berkontribusi dalam bidang ini.
            </p>
        </section>
    );
};

export default About;
